import { useState } from 'react';
import styled from 'styled-components';
import SearchIcon from '@mui/icons-material/Search';
import Badge from '@mui/material/Badge';
import { ShoppingCartOutlined, Favorite } from '@mui/icons-material/';
import { mobile, tablet } from '../responsive';
import { Link, useNavigate } from 'react-router-dom';
import { logout, refreshToken } from "../redux/apiCalls";
import { useDispatch, useSelector } from "react-redux";
import { Trans } from 'react-i18next';


const Container = styled.div`
    height: 60px;
    margin-bottom: 10px;
`;

const Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    ${tablet({ fontSize: '10px' })};
    ${mobile({ padding: '0' })};
`;

const Left = styled.div`
    flex: 1;
    display: flex;
    align-items: center;
`;

const Language = styled.select`
    font-size: 14px;
    cursor: pointer;
    ${mobile({ display: 'none' })}
`;

const Option = styled.option`
    background-color: teal;
    &:hover{
        background-color: teal;
    }
`

const SearchContainer = styled.div`
    border: 0.5px solid lightgray;
    display: flex;
    align-items: center;
    margin-left: 25px;
    padding: 5px;
`;

const Input = styled.input`
    border:none;
    padding: 5px;
    ${mobile({ width: '50px' })}
`;


const Center = styled.div`
    flex: 1;
    text-align: center;
`;

const Logo = styled.h1`
    font-weight: bold;
    ${mobile({ fontSize: '16px', marginLeft: '10px'})}
`;


const Right = styled.div`
    flex: 1;
    display: flex;
    align-items: center;
    justify-content: flex-end;
    ${mobile({ flex: '2', justifyContent: 'center'})}
`;


const MenuItem = styled.div`
    font-size: 14px;
    cursor: pointer;
    margin-left: 25px;
    ${mobile({ fontSize: '10px', marginLeft: '10px'})}
`;

const Navbar = () => {
    const cartQuantity = useSelector(state => state.cart.quantity);
    const wishlistQuantity = useSelector(state => state.wishlist.quantity);
    const user = useSelector(state => state.user.currentUser);
    const dispatch = useDispatch();
    const [search, setSearch] = useState('');
    const navigate = useNavigate();

    const handleClick = (e) => {
        e.preventDefault();
        logout(dispatch, user);
        navigate("/");
    };

    const handleSearch = (e) => {
        e.preventDefault()
        setSearch(e.target.value)
    };

    const handleSearchClick = () => {
        search && navigate(`/product_search/${search}`)
    };

    const refresh = refreshToken();

  return (
    <div>
        <Container>
            <Wrapper>
                <Left>
                    <Language>
                        {/* <Option><Trans i18nKey="Navbar.language"></Trans></Option> */}
                    </Language>
                    <SearchContainer>
                        <Input placeholder='search' onChange={handleSearch} /> 
                        <SearchIcon style={{ color: 'gray', fontSize: '16px' }} onClick={handleSearchClick} />
                    </SearchContainer>
                </Left>
                <Center>
                    <Logo>
                        <Link to="/" style={{ textDecoration: 'none' }}>VINOGRADNIK BESSARABII</Link>
                    </Logo>
                </Center>
                <Right>
                    {user 
                        ? <MenuItem onClick={(e) => handleClick(e)}>LOGOUT</MenuItem>
                        :
                        <>
                            <Link to="/register">
                                <MenuItem>REGISTER</MenuItem> 
                            </Link>
                            <Link to="/login">
                                <MenuItem>SIGN IN</MenuItem>
                            </Link>
                        </>
                    }
                    <Link to="/wishlist">
                        <MenuItem>
                            <Badge 
                                badgeContent={wishlistQuantity} 
                                color="primary"
                            >
                                <Favorite color="action" />
                            </Badge>
                        </MenuItem>
                    </Link>
                    <Link to="/cart">
                        <MenuItem>
                            <Badge 
                                badgeContent={cartQuantity} 
                                color="primary"
                            >
                                <ShoppingCartOutlined color="action" />
                            </Badge>
                        </MenuItem>
                    </Link>
                </Right>
            </Wrapper>
        </Container>
    </div>
  )
}

export default Navbar
